import {
    // Remove or comment out unused imports
    // FormGroup,
    // FormControlLabel,
    // Avatar,
    // Checkbox,
    // Alert
  } from "@mui/material";  
  import img1 from "../img/img1.png";
  import { Link } from "react-router-dom"; // Import Link from react-router-dom
  import "./Login.css";

  const Login = () => {
    // Function to handle sign in button click
    const handleSignIn = () => {
      // Perform sign in logic here
      console.log("Sign in button clicked");
    };

    return (
      <Grid container justifyContent="center" mt={3} spacing={3}>
        <Grid item xs={12} sm={12}>
          <Card
            variant="outlined"
            sx={{ maxWidth: 500, margin: "0 auto", marginTop: 3 }}
          >
            <CardContent sx={{ padding: "32px" }}>
              <Box>
                <Box
                  sx={{
                    display: "flex",
                    justifyContent: "center"
                  }}
                >
                  <MuiLink component={Link} to="/">
                    {/* Use MuiLink instead of Link */}
                    <img src={img1} alt="icon" width={174} height={70} />
                  </MuiLink>
                </Box>
                <Box
                  sx={{
                    display: "flex",
                    justifyContent: "center"
                  }}
                >
                  <Typography
                    color="textSecondary"
                    variant="subtitle1"
                    fontWeight="400"
                  >
                    Innoventures
                  </Typography>
                </Box>
              </Box>

              <Box
                textAlign="center"
                position="relative"
                mb={1}
                mt={4}
                sx={{
                  "&::before": {
                    content: '""',
                    background: (theme) =>
                      `${
                        theme.palette.mode === "dark" ? "#42464d" : "#ecf0f2"
                      }`,
                    height: "1px",
                    width: "100%",
                    position: "absolute",
                    left: "0",
                    top: "13px"
                  }
                }}
              >
                <Typography
                  component="span"
                  color="textSecondary"
                  variant="h6"
                  fontWeight="400"
                  position="relative"
                  px={2}
                  sx={{
                    background: (theme) =>
                      `${theme.palette.mode === "dark" ? "#282c34" : "#fff"}`
                  }}
                >
                  Sign In
                </Typography>
              </Box>

              <Stack>
                <Box sx={{ mb: "30px" }}>
                  <FormLabel htmlFor="email">Email Address</FormLabel>
                  <TextField id="email" variant="outlined" fullWidth />
                </Box>
                <Box>
                  <FormLabel htmlFor="password">Password</FormLabel>
                  <TextField
                    id="password"
                    type="password"
                    variant="outlined"
                    fullWidth
                  />
                </Box>
                <Stack
                  justifyContent="space-between"
                  direction="row"
                  alignItems="center"
                  my={2}
                >
                  <Typography fontWeight="500">
                    <MuiLink component={Link} to="#" underline="none">
                      Forgot Password ?
                    </MuiLink>
                  </Typography>
                </Stack>
              </Stack>
              <Box>
                <Button
                  color="primary"
                  variant="contained"
                  size="large"
                  fullWidth
                  onClick={handleSignIn} // Add onClick handler
                >
                  Sign In
                </Button>
              </Box>

              <Stack
                justifyContent="space-between"
                direction="row"
                alignItems="center"
                my={2}
              >
                <Typography fontWeight="500" color="textSecondary">
                  New to Modernize?
                </Typography>

                <Typography fontWeight="500">
                  <MuiLink component={Link} to="#" underline="none">
                    Create an account
                  </MuiLink>
                </Typography>
              </Stack>
            </CardContent>
          </Card>
        </Grid>
        <Grid item lg={12}></Grid>
      </Grid>
    );
  };

  export default Login;
